'''
tag: ^1277 ^medium ^array  ^dp
name: ^(Count Square Submatrices with All Ones)
'''
class Solution:
    def countSquares(self, matrix) -> int:
        x_set = set()
        m = len(matrix)
        n = len(matrix[0])
        min_num = min(m, n)
        print('{}*{}'.format(m, n))
        print('min={}'.format(min_num))

        ret = 0
        for y in range(m):
            for x in range(n):
                if matrix[y][x] == 1:
                    ret += 1

        for interval in range(1, min_num):
            squre = (interval+1) **2
            for x in range(0, n - interval):
                for y in range(0, m - interval):
                    sum_total = 0
                    for j in range(0, interval + 1):
                        sum_total += sum(matrix[y+j][x:x+interval])
                    if sum_total==squre:
                        ret+=1

        return ret


